import { InputGroup, FormControl, Button } from "react-bootstrap";
import styles from "./SearchBar.module.css";

const SearchBar = () => {
  return (
    <div className={styles.searchBar}>
      <InputGroup>
        <FormControl
          placeholder="Search..."
          aria-label="Search..."
          aria-describedby="basic-addon2"
        />
        <InputGroup.Append>
          <Button variant="success" variant="outline-secondary">
            Button
          </Button>
        </InputGroup.Append>
      </InputGroup>
    </div>
  );
};

export default SearchBar;
